'                            groups.push([cls])\n'+
'                        }\n'+
'                        end = cls[1][2];\n'+
'                    }\n'+
'                    for (var k = 0 ; k < groups.length ; k++) {\n'+
'                        var group = groups[k];\n'+
'                        var groupStart = group[0][1][1];\n'+
'                        var groupEnd = group[group.length - 1][1][2]\n'+
'                        var groupHolder;\n'+
'                        var thisHolder = groupHolder = holder;\n'+
'                        var singleMode = group.length === 1;\n'+
'                        if (!singleMode) {\n'+
'                            groupHolder = thisHolder = $("<div class=\'placeholder\'></div>");\n'+
'                            holder.append(thisHolder);\n'+
'                        }\n'+
'                        // kinda sketchy, but will work for now. Consider changing to more functional\n'+
'                        var holdOffset = offset;\n'+
'                        for (var i = 0 ; i < group.length ; i++) {\n'+
'                            offset = holdOffset;\n'+
'                            var cls = group[i];\n'+
'                            var start = cls[1][1];\n'+
'                            var finish = cls[1][2];\n'+
'                            var classType = cls[3];\n'+
'                            var classCode = cls[2][0];\n'+
'                            var className = cls[2][1];\n'+
'                            var location = cls[0];\n'+
'\n'+
'                            var height = finish - start;\n'+
'                            var classTitle = [classCode];\n'+
'                            var cssCls = "class " + classType\n'+
'                            if (singleMode) {\n'+
'                                if (!weekMode) {\n'+
'                                    classTitle.push(className);\n'+
'                                }\n'+
'                                classTitle.push(classType);\n'+
'                                cssCls += " placeholder"\n'+
'                            } else {\n'+
'                                // classType shows when singleMode or weekmode, not both\n'+
'                                if (!weekMode) {\n'+
'                                    classTitle.push(classType);\n'+
'                                }\n'+
'                                thisHolder = $("<div style=\'display:inline;\'></div>");\n'+
'                                groupHolder.append(thisHolder);\n'+
'                            }\n'+
'\n'+
'                            var classInfo = [classTitle.join(" - "), location];\n'+
'                            addPlaceholder(thisHolder,groupStart,start);\n'+
'                            addTimeSlot(thisHolder,cssCls,height,classInfo,group.length);\n'+
'                            addPlaceholder(thisHolder,finish,groupEnd);\n'+
'                        }\n'+
'                        var end = k === groups.length - 1 \n'+
'                            ? endTime\n'+
'                            : groups[k+1][0][1][1];\n'+
'                        addPlaceholder(thisHolder,groupEnd,end);\n'+
'                    }\n'+
'                    addTimeSlot(holder,"placeholder placeborder",0);\n'+
'                }\n'+
'                all.append(holder).append("<div id=\'side\'></div>");\n'+
'            }\n'+
'            $("#container").html(all);\n'+
'            resize();\n'+
'        });\n'+
'    }\n'+
'\n'+
'    function addPlaceholder(container,start,end) {\n'+
'        while (start < end) {\n'+
'            var nextHour = Math.floor((start + 60)/60) * 60;\n'+
'            var next = nextHour < end ? nextHour : end;\n'+
'            var length = next - start;\n'+
'            var cls = "placeholder";\n'+
'            if (start % 60 === 0) {\n'+
'                cls += " placeborder";\n'+
'            }\n'+
'            addTimeSlot(container,cls,length);\n'+
'            start += length;\n'+
'        }\n'+
'    }\n'+
'\n'+
'    function addTimeSlot(container,classType,time,content,share) {\n'+
'        //do no need to account for border as using box-sizing:border-box\n'+
'        var height = time/(60/pxPerHr);\n'+
'        var thisHeight = height + offset;\n'+
'        offset = thisHeight % 1;\n'+
'        thisHeight = Math.floor(thisHeight);\n'+
'\n'+
'        var thisContent = "";\n'+
'        if (content && content.length) {\n'+
'            thisContent = "<p style=\'top:" + (thisHeight - 15.2 * content.length)/2 + "px\'>" + content.join("<br />") + "</p>";\n'+
'        }\n'+
'        var style = "height:" + thisHeight + "px;" + (share > 1 ? "width:" + (100/share) + "%;" : "")\n'+
'        container.append("<div class=\'" + classType + "\' style=\'" + style + "\'>" + thisContent + "</div>");\n'+
'    }\n'+
'\n'+
'    function sameDay(day1,day2) {\n'+
'        var date1 = new Date(day1);\n'+
'        var date2 = new Date(day2);\n'+
'        return date1.getDate()==date2.getDate()&&date1.getMonth()==date2.getMonth()&&date1.getYear()==date2.getYear();\n'+
'    }\n'+
'})();\n'+
'\n'+
'function showNow(container,weekMode) {\n'+
'    clearTimeout(nowTimer);\n'+
'    var holder = $("<div id=\'nowHolder\'></div>");\n'+
'    var ele = $("<div id=\'now\'></div>");\n'+
'    holder.html(ele);\n'+
'    container.prepend(holder);\n'+
'    nowTimeOffset = 50 * !weekMode;\n'+
'    holder.css("left",-nowTimeOffset);\n'+
'    moveNow();\n'+
'\n'+
'    function moveNow() {\n'+
'        now = new Date();\n'+
'        if (now.getHours() < startTime/60 || now.getHours() >= endTime/60) {\n'+
'            holder.css("display","none");\n'+
'        } else {\n'+
'            var text = (now.getHours())+":"+("0"+now.getMinutes()).slice(-2)+"AM";\n'+
'            if (now.getHours()>=13) {\n'+
'                text = (now.getHours()-12)+":"+("0"+now.getMinutes()).slice(-2)+"PM";\n'+
'            } else if (now.getHours()==12) {\n'+
'                text = (now.getHours())+":"+("0"+now.getMinutes()).slice(-2)+"PM";\n'+
'            }\n'+
'            var position = Math.floor((now.getHours() - (startTime)/60) * 50 + now.getMinutes()/1.2);\n'+
'            ele.text(text);\n'+
'            holder.css("display","block").css("top",position);\n'+
'            var delay = 60000 - now.getSeconds()*1000 - now.getMilliseconds();\n'+
'            nowTimer = setTimeout(function() {\n'+
'                moveNow();\n'+
'            },delay);\n'+
'        }\n'+
'    }\n'+
'}\n'+
'\n'+
'function weekView(mode) {\n'+
'    weekMode = mode === undefined ? !weekMode : mode;\n'+
'    var date = $("#datepicker").datepicker("getDate");\n'+
'    if (weekMode) {\n'+
'        $("#showWeek").val("Show Day");\n'+
'        showWeek(date);\n'+
'    } else {\n'+
'        $("#showWeek").val("Show Week");\n'+
'        changeDate(date);\n'+
'    }\n'+
'}\n'+
'\n'+
'function next() {\n'+
'    var date = $("#datepicker").datepicker("getDate");\n'+
'    if (weekMode) {\n'+
'        date.setDate(date.getDate() + 7);\n'+
'        showWeek(date);\n'+
'    } else {\n'+
'        date.setDate(date.getDate() + 1);\n'+
'        changeDate(date);\n'+
'    }\n'+
'    $("#datepicker").datepicker("setDate",date);\n'+
'}\n'+
'\n'+
'function prev() {\n'+
'    var date = $("#datepicker").datepicker("getDate");\n'+
'    if (weekMode) {\n'+
'        date.setDate(date.getDate() - 7);\n'+
'        showWeek(date);\n'+
'    } else {\n'+
'        date.setDate(date.getDate() - 1);\n'+
'        changeDate(date);\n'+
'    }\n'+
'    $("#datepicker").datepicker("setDate",date);\n'+
'}\n'+
'\n'+
'function setToday() {\n'+
'    now = new Date();\n'+
'    $("#datepicker").datepicker("setDate",now);\n'+
'    if (weekMode) {\n'+
'        showWeek(now);\n'+
'    } else {\n'+
'        changeDate(now);\n'+
'    }\n'+
'}\n'+
'</script>'+
'<script>'+
'$(document).on("swipeleft",next);\n'+
'$(document).on("swiperight",prev);\n'+
'$(document).on("orientationchange",function(e){\n'+
'    weekView(e.orientation === "landscape")\n'+
'});\n'+
'var doubleTap = 0;\n'+
'// double click changes to today\n'+
'$(document).on("vclick",function(e){\n'+
'    var test = new Date();\n'+
'    if (test - doubleTap > 300) {\n'+
'        doubleTap = test;\n'+
'    } else {\n'+
'        e.preventDefault();\n'+
'        setToday();\n'+
'    }\n'+
'});\n'+
'\n'+
'scheduleInit($("body"),{weekSchedule: weekSchedule});\n'+
'</script>'+
'</body>\n'+
'</html>\n'+
'';